import React, { Component } from "react";

class Feed extends Component {
  render() {
    return (
      <div key={this.props.id}>
        <h3>{this.props.username}</h3>
        <a>
          Curtidas: {this.props.curtidas}, Comentários: {this.props.comentarios}
        </a>
      </div>
    );
  }
}

export default Feed;
